import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [bestCPU, setBestCPU] = useState({});
  const [allCPUs, setAllCPUs] = useState([]);

  useEffect(() => {
    // Fetch the best CPU
    axios.get('http://localhost:3001/best-cpu')
      .then(response => {
        setBestCPU(response.data);
      })
      .catch(error => {
        console.error('Error fetching best CPU:', error);
      });

    // Fetch all CPUs
    axios.get('http://localhost:3001/cpus')
      .then(response => {
        setAllCPUs(response.data);
      })
      .catch(error => {
        console.error('Error fetching CPUs:', error);
      });
  }, []);

  return (
    <div>
      <h1>Best CPU</h1>
      <table>
        <thead>
          <tr>
            <th>CPU</th>
            <th>RP</th>
            <th>Price</th>
            <th>PPD</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{bestCPU.CPU}</td>
            <td>{bestCPU.RP}</td>
            <td>{bestCPU.Price}</td>
            <td>{bestCPU.PPD}</td>
          </tr>
        </tbody>
      </table>

      <h1>All CPUs</h1>
      <table>
        <thead>
          <tr>
            <th>CPU</th>
            <th>RP</th>
            <th>Price</th>
            <th>PPD</th>
            <th>Price Increase (%)</th>
            <th>Performance Increase (%)</th>
          </tr>
        </thead>
        <tbody>
          {allCPUs.map(cpu => (
            <tr key={cpu.CPU}>
              <td>{cpu.CPU}</td>
              <td>{cpu.RP}</td>
              <td>{cpu.Price}</td>
              <td>{cpu.PPD}</td>
              <td>{cpu.Price_increase}</td>
              <td>{cpu.Performance_increase}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default App;
